import React from 'react';
import GalleryData from './GalleryData';

function FilterGallery(){
    return(
        <>
            <h1 className='mt-5 bg-white text-white text-center main-heading'>Select your favorite Picture</h1>
            <hr />
            <div className='menu-tabs bg-white container'>
                <div className='menu-tab d-flex justify-content-around'>
                    <button className='btn btn-warning'>Angel</button>
                </div>

            </div>
        </>
    )
}

export default FilterGallery;
